package main

import (
	"testing"

	"github.com/go-playground/assert/v2"
)

func TestSolution(t *testing.T) {

	testCases := []struct {
		name string
		s, t string
		want bool
	}{
		{name: "first", s: "abc", t: "ahbgdc", want: true},
		{name: "second", s: "axc", t: "ahbgdc", want: false},
		{name: "third", s: "bcd", t: "", want: true},
	}

	for _, tt := range testCases {
		t.Run(tt.name, func(t *testing.T) {
			assert.Equal(t, tt.want, isSubsequence(tt.s, tt.t))
		})
	}

	t.Log("pass")
}
